import React from "react";
import {truck ,cement ,} from '../../utils/Icon';

import { frame } from "../../utils/Constant";

const Frame = () => {

  return (
    <div className="Frame w-full h-auto">

        <div className="grid gap-8 grid-cols-4 grid-rows-2 ">
          {frame.map((k, i) => {
            return <span className="ring-1" key={i}>{k.title},{k.image}</span>;
             <span className="ring-1" key={i}>{k.image}</span>;
          })}
        </div>

      </div>
  );
};

export default Frame;
